import React from "react";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";

const PerfectWeight = props => {
  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        padding: "0",
        margin: 0
      }}
    >
      <strong>{props.title}</strong>
      <BarChart
        width={600}
        height={300}
        data={props.data}
        margin={{ top: 15, right: 90, left: 90, bottom: 5 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="x" />
        <YAxis domain={[0, 5]} />
        <Tooltip />
        <Legend />
        <Bar dataKey="My weight" fill="royalblue" />
        <Bar dataKey="Perfect Weight" fill="skyblue" />
      </BarChart>
    </div>
  );
};

export default PerfectWeight;
